import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./listingitem.scss";
import examplePic from "../../images/currentcribexample.png";

export class ListingItem extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="main-item">
        <div className="row no-gutters">
          <div className="col-lg-6 listingimage">
            <img src={examplePic} />
          </div>
          <div className="col-lg-6 listing-info">
            <div className="row mx-auto no-gutters">
              <div className="col-lg-9 listing-info-title">181 Lester St.</div>
              <div className="col-lg-3">
                <div className="listing-info-price-container">$750</div>
              </div>
            </div>
            <div className="row mx-auto no-gutters listing-info-poster">
              j6chiang
            </div>
            <div className="row no-gutters listing-info-divider"></div>
            <div className="row mx-auto no-gutters">number of shits</div>
          </div>
        </div>
      </div>
    );
  }
}
